func numberOfPowerfulInt(start int64, finish int64, limit int, s string) int64 {
    var count int64 = 0
    suffixValue, _ := strconv.ParseInt(s, 10, 64)
    if suffixValue < start || suffixValue > finish {
        return 0
    }

    // Calculate the minimum and maximum values that can prepend the suffix
    minPrepend, maxPrepend := "", ""
    for i := 0; i < len(s); i++ {
        minPrepend += "0"
        maxPrepend += strconv.Itoa(limit)
    }
    minPrependValue, _ := strconv.ParseInt(minPrepend, 10, 64)
    maxPrependValue, _ := strconv.ParseInt(maxPrepend, 10, 64)

    for i := minPrependValue; i <= maxPrependValue; i++ {
        valStr := strconv.FormatInt(i, 10) + s
        val, _ := strconv.ParseInt(valStr, 10, 64)
        if val >= start && val <= finish {
            count++
        }
        if val > finish {
            break
        }
    }

    return count
}
